import React from 'react';
import {
    PieChart,
    Pie,
    Cell,
    ResponsiveContainer
} from 'recharts';

import { 
    Container,
    SideLeft,
    LegendContainer,
    Legend,
    SideRight,
 }  from './styles';


 interface IPieChartProps {
     data: {
        name: string;
        value: number;
        percent: number;
        color: string;
     }[];
 }

const PieChartBox: React.FC = () => (
    <Container>
        <SideLeft>
           <h4>Space occupied vs free space</h4>
           <br/>
            <LegendContainer>
                <Legend color="#F7931B">
                    <div>95%</div>
                    <span>Space occupied</span>
                </Legend>
                <Legend color="#E44C4E">
                    <div>95%</div>
                    <span>Free space</span>
                </Legend>
            </LegendContainer>
        </SideLeft>

        <SideRight>
            <ResponsiveContainer>
                <PieChart>
                    <Pie data={[{amount:30, percent:95}]} 
                    labelLine={false} 
                    dataKey="percent" />
                </PieChart>
            </ResponsiveContainer>
        </SideRight>

       
    </Container>
);

export default PieChartBox;
